import React from 'react';

const DailyCheckPanicButtonInput = () => (
  <div className="min-h-screen flex flex-col items-center justify-center bg-gray-50 fade-in">
    <div className="bg-white rounded-lg shadow p-8 w-full max-w-md text-center">
      <h2 className="text-xl font-semibold mb-4">Daily Check Panic Button</h2>
      <div className="text-gray-400">(Form dummy, belum tersedia)</div>
    </div>
  </div>
);

export default DailyCheckPanicButtonInput;
